import styled from "styled-components";

const Container = styled.div`
    display: flex;

    align-items: center;
    justify-content: flex-start;
`;

const Text = styled.div`
    font-family: 'Oooh Baby', cursive;
    font-size: 75px;
`;

                                                
const Logo = () => {
    return(
    <Container>
        <Oval/>
        <TextContainer>            
            <Text>CULT</Text>
            <Image src={require("../images/letterR.png")}/>
        </TextContainer>
        <SubTextContainer>
            <SubText>M A G A Z I N E</SubText>
        </SubTextContainer>
    </Container>
    );   
}

export default Logo;
